function prepareSearchParameters(searchParams, mode) {
	function deepCopy(obj) {
		if (obj === null || typeof obj !== 'object') return obj;

		if (obj instanceof Date) return new Date(obj.getTime());

		if (Array.isArray(obj)) return obj.map(deepCopy);

		const copy = {};
		for (const key in obj) {
			if (Object.prototype.hasOwnProperty.call(obj, key)) {
				copy[key] = deepCopy(obj[key]);
			}
		}
		return copy;
	}
	if (searchParams == null && mode == null) {
		return;
	}

	if (mode === 'off') {
		return {
			search_parameters: { mode },
		};
	}

	if (mode != null) {
		const searchParamsCopy = deepCopy(searchParams || {});
		searchParamsCopy.mode = mode;

		if (searchParamsCopy.from_date) {
			searchParamsCopy.from_date = iml.formatDate(searchParamsCopy.from_date, 'YYYY-MM-DD');
		}

		if (searchParamsCopy.to_date) {
			searchParamsCopy.to_date = iml.formatDate(searchParamsCopy.to_date, 'YYYY-MM-DD');
		}

		searchParamsCopy.sources?.forEach((source) => {
			if (source.filterBy) {
				source.filterBy = undefined;
			}
		});

		return searchParamsCopy;
	}

	return searchParams;
}

