function adjustAnalyzeImgsResponse(response, parseJSONResponse) {
	// the function is applicable to the /chat/completions endpoint
	// therefore it may be reused in modules other than Analyze Image(s) as well

	if (typeof response !== 'object')
		throw TypeError('"response" should be an object.');
	if (Array.isArray(response))
		throw TypeError('"response" should be an object.');
	if (!response.hasOwnProperty('choices'))
		throw TypeError('"response.choices" is missing.');
	if (!Array.isArray(response.choices))
		throw TypeError('"response.choices" is not an array.');

	// relevant in case of the chat completion
	const choiceWithMessage = response.choices.find(
		(choice) => choice.message && choice.message.content
	);
	if (choiceWithMessage) {
		let result;

		try {
			result = parseJSONResponse
				? JSON.parse(choiceWithMessage.message.content)
				: choiceWithMessage.message.content;
		} catch (error) {
			result = choiceWithMessage.message.content;
		}

		return {
			result,
			...response,
		};
	}

	// relevant in case of the prompt completion
	const choiceWithText = response.choices.find((choice) => choice.text);
	if (choiceWithText) {
		let result;

		try {
			result = parseJSONResponse
				? JSON.parse(choiceWithText.text)
				: choiceWithText.text;
		} catch (error) {
			result = choiceWithText.text;
		}

		return {
			result,
			...response,
		};
	}

	return response;
}

