function prepareMessagesForChatCompletion(messages) {
	if (!messages) { //?For when prompt completion is used
		return undefined;
	}

	return messages.map((message) => {
		const format = message.imageFile?.imageFilename?.split(".")?.pop();
		return {
			role: message.role,
			content: message.imageInputType ?
				[
					{
						...(
							message.content &&
							{
								type: 'text',
								text: message.content
							}
						)
					},
					{
						...(
							(message.imageUrl || message.imageFile) &&
							{
								type: 'image_url',
								image_url: {
									detail: message.imageDetail,
									url: message.imageUrl ?? `data:image/${format};base64,${message.imageFile.imageData.toString('base64')}`
								}
							}
						)
					}
				] :
				message.content
		};
	});
}

